import React from "react";
import { Route,Routes } from "react-router-dom";
import AHome from "./Home";

const AdminRouting = () =>{
    return(
      <>

            <Routes>
            <Route path="/home" element={<AHome />} />
            </Routes>


    </>
    );
}
export default AdminRouting;
